function logMessage(user, message, type) {
	const stream = fs.createWriteStream("log.txt", { flags: "a" });

	const data = {
		d: moment().format("YYYY.MM.DD hh:mm:ss"),
		u: user,
		a: message,
		t: type,
	};
	stream.write(JSON.stringify(data) + ",\n");
	stream.end();
}

